    params = {}
    start = url_path.find('{')
    while start == -1:
        end = url_path.find('}', start)
        if end == -1:
            break
        param_str = url_path[start + 1:end]
        (key, value) = param_str.split('=')
        params[key] = value
        start = url_path.find('{', end)
    return params

